import MotApp from "./MotApp";

const express = require("express");
const request = require("request");

const app = express();

app.use((req, res, next) => {
  res.header("Access-Control-Allow-Origin", "*");
  next();
});

function App() {
  return <MotApp />;
}

export default App;
